import axios from 'axios';

const SpringPatientsListApiUrl="http://localhost:8080/cancerMoonshot/getPatientDetailsKeyValue";

class PatientsList{

    getApi(){
        return axios.get(SpringPatientsListApiUrl);
    }
}
export default new PatientsList();
